  `medical` double NOT NULL,
  `ewc` double NOT NULL,
  `rmi` double NOT NULL,
  `ltt` double NOT NULL,
  `constigency` double NOT NULL,
  `develop` double NOT NULL,
  `caution` double NOT NULL,
  `pocket` double NOT NULL,
  `mock` double NOT NULL,
